import React from "react";
import AddPincode from "./AddPincode.component"
import Navbar from "../Header/Navbar"
import Footer from "../Footer/Footer"
const FinalAddPincode = () => {
    return (
        <>
            <Navbar />
            <AddPincode />
            <Footer /> 
        </>
    )
}
export default FinalAddPincode;
